import React from 'react';
import { motion } from 'framer-motion';
import TopPage from '../components/TopPage';
import Footer from '../components/Footer';
import { FaPaintBrush, FaCube, FaCode, FaLaptop } from 'react-icons/fa';
import './About.css';

function About() {
  // Animation variant for fade/slide in effect.
  const fadeInUp = {
    hidden: { opacity: 0, y: 20 },
    visible: { opacity: 1, y: 0 }
  };

  // Honors data from your provided content.
  const honors = [
    "Children's Science Foundation Award – Secured 3 STEM patents before age 18, recognizing innovation",
    "Asian Space Settlement Design Challenge – Gold Medalist: success in Nationals & Regionals as well",
    "3rd in World Series of Innovation by Network for Tech & Entrepreneurship – Prize: $500",
    "Moonshot Pirates '23, Shape the Future Challenge – Top 7 global finalist, ranked out of 500+ teams"
  ];

  // Extracurricular activities (ECs) data.
  const ecs = [
    "Head Developer & Patentee, CAR.L.A – Created a vehicle device addressing Motor Vehicles Act,1988 loopholes; curbing pollution and saving money (in process of govt. tie-up)",
    "Freelance 3D Artist – Designed on platforms like CGTrader; earned $2500+ with 25+ professional designs sold (Personal site: pranavchahal.art)",
    "Patentee, OT 2'3 Engine – Developed new combustion engine designs using nanoparticles and dual rotor system; finalist for Future Port Awards '23",
    "Developer & Patentee, Shared Computing Architecture – Enabled sharing CPU & memory over 5G; offloaded tasks to nearby CPUs for faster, secure and cost-efficient processing",
    "HOD of 3D Dept., Space Settlement Design Challenge – Led a team of 7 designers in a larger team of 50 across 3 rounds",
    "Individual Researcher – Explored superhydrophobic surfaces & nanomaterials for self-cleaning cars, reducing dirt adhesion for automotive maintenance"
  ];

  return (
    <>
      <TopPage />
      <main className="about-main">
        {/* Introduction Section */}
        <motion.section
          className="about-intro"
          initial="hidden"
          whileInView="visible"
          variants={fadeInUp}
          transition={{ duration: 0.6 }}
          viewport={{ once: true }}
        >
          <h2>About Me</h2>
          <p>
            I'm Pranav Chahal – a creative innovator with a strong blend of 3D design, programming, and web development expertise.
            I merge design and technology to bring visionary projects to life.
          </p>
        </motion.section>

        {/* Honors Section */}
        <motion.section
          className="honors"
          initial="hidden"
          whileInView="visible"
          variants={fadeInUp}
          transition={{ duration: 0.6, delay: 0.2 }}
          viewport={{ once: true }}
        >
          <h3>Honors & Awards</h3>
          <ul>
            {honors.map((item, index) => (
              <motion.li
                key={index}
                initial={{ opacity: 0, x: -20 }}
                whileInView={{ opacity: 1, x: 0 }}
                transition={{ duration: 0.5, delay: index * 0.1 }}
                viewport={{ once: true }}
              >
                {item}
              </motion.li>
            ))}
          </ul>
        </motion.section>

        {/* Extracurricular Activities Section */}
        <motion.section
          className="ecs"
          initial="hidden"
          whileInView="visible"
          variants={fadeInUp}
          transition={{ duration: 0.6, delay: 0.4 }}
          viewport={{ once: true }}
        >
          <h3>Extracurriculars</h3>
          <ul>
            {ecs.map((item, index) => (
              <motion.li
                key={index}
                initial={{ opacity: 0, x: 20 }}
                whileInView={{ opacity: 1, x: 0 }}
                transition={{ duration: 0.5, delay: index * 0.1 }}
                viewport={{ once: true }}
              >
                {item}
              </motion.li>
            ))}
          </ul>
        </motion.section>

        {/* Startups & Projects Section */}
        <motion.section
          className="startups"
          initial="hidden"
          whileInView="visible"
          variants={fadeInUp}
          transition={{ duration: 0.6, delay: 0.6 }}
          viewport={{ once: true }}
        >
          <h3>Startups & Projects</h3>
          <div className="startup-list">
            <div className="startup-item">
              <img src="/images/startup1-logo.png" alt="Startup One Logo" className="startup-logo" />
              <div className="startup-info">
                <h4>Startup One</h4>
                <p>A cutting-edge tech startup focusing on augmented reality experiences.</p>
                <a href="https://startupone.com" target="_blank" rel="noopener noreferrer">Visit Website</a>
              </div>
            </div>
            <div className="startup-item">
              <img src="/images/startup2-logo.png" alt="Startup Two Logo" className="startup-logo" />
              <div className="startup-info">
                <h4>Startup Two</h4>
                <p>A creative agency blending design and technology to drive innovation.</p>
                <a href="https://startuptwo.com" target="_blank" rel="noopener noreferrer">Visit Website</a>
              </div>
            </div>
            {/* You can add more startup items as needed */}
          </div>
        </motion.section>

        {/* Skills Section */}
        <motion.section
          className="skills"
          initial="hidden"
          whileInView="visible"
          variants={fadeInUp}
          transition={{ duration: 0.6, delay: 0.8 }}
          viewport={{ once: true }}
        >
          <h3>Skills</h3>
          <div className="skills-list">
            <div className="skill-item">
              <FaPaintBrush size={40} color="#ff6347" />
              <span>Designing</span>
            </div>
            <div className="skill-item">
              <FaCube size={40} color="#00ffff" />
              <span>3D Designing</span>
            </div>
            <div className="skill-item">
              <FaCode size={40} color="#61dafb" />
              <span>Programming</span>
            </div>
            <div className="skill-item">
              <FaLaptop size={40} color="#f0db4f" />
              <span>Web Development</span>
            </div>
          </div>
        </motion.section>
      </main>
      <Footer />
    </>
  );
}

export default About;
